import React, { useEffect, useState } from "react";

export const OfertaTrabajo = () => {
  const [practicas, setPracticas] = useState([]);

  useEffect(() => {
    fetch("/practicas")
      .then((response) => response.json())
      .then((data) => {
        setPracticas(data);
      })
      .catch((error) => {
        console.error('Error al obtener prácticas desde la API:', error);
      });
  }, []);

  return (
    <div className="w-3/4 m-auto">
      {practicas.map((practica) => (
        <div key={practica.id} className="py-6">
          {/* Resto del componente sigue igual... */}
        </div>
      ))}
    </div>
  );
};
